import React from 'react';
import '../App.css';

const dealerStyle = {
  width: '100%'
}

const BlackjackGame = () => {
  return (
    <div>
      <div className='Dealer'>
        Dealer
      </div>
      <div>
        Player
        <button>HIT</button>
        <button>STAY</button>
        <button>PLAY AGAIN</button>
      </div>
      <div className='AI' width='50px'>
        AI
      </div>
    </div>
)
}

export default BlackjackGame;
